// Filter for new hires (hire date within last 14 days)
const items = $input.all();
const now = new Date();
const cutoffDate = new Date(now.getTime() - (14 * 24 * 60 * 60 * 1000));

const newHires = [];

for (const item of items) {
  const user = item.json;
  const hireDateStr = user.custom_field_31;
  if (!hireDateStr) continue;

  const parts = hireDateStr.split('/');
  if (parts.length !== 3) continue;

  const hireDate = new Date(parts[2], parts[0] - 1, parts[1]);

  if (hireDate >= cutoffDate && user.status === 'active') {
    newHires.push({
      json: {
        user_id: user.id,
        name: `${user.first_name} ${user.last_name}`,
        email: user.email,
        hire_date: hireDateStr
      }
    });
  }
}

if (newHires.length === 0) {
  return [{ json: { skip: true, message: 'No new hires found' } }];
}

return newHires;

// Find courses completed in the last 24 hours (TESTING - change to 1 hour for prod)
const user = $input.first().json;
const courses = user.courses || [];
const userName = `${user.first_name} ${user.last_name}`;

const now = Date.now();
const timeWindow = now - (30 * 60 * 1000); // 30 minutes for production

const recentCompletions = [];

for (const course of courses) {
  if (course.completion_status !== 'completed') continue;

  const completedTimestamp = parseInt(course.completed_on_timestamp) * 1000;

  if (completedTimestamp >= timeWindow) {
    recentCompletions.push({
      json: {
        user_id: user.id,
        user_name: userName,
        course_id: course.id,
        course_name: course.name.replace(/&amp;/g, '&'),
        completed_on: course.completed_on,
        total_time_seconds: course.total_time_seconds || 0
      }
    });
  }
}

if (recentCompletions.length === 0) {
  return [{ json: { skip: true, message: 'No recent completions' } }];
}

return recentCompletions;

// Process completions with duplicate check using chat history from previous node
const chatHistory = $input.first().json;
const completions = $('Has Completions?').all();
const webhookUrl = 'https://chat.googleapis.com/v1/spaces/AAQA4Ksbm-M/messages?key=AIzaSyDdI0hCZtE6vySjMm-WEfRq3CPzqKqqsHI&token=UPaxjAUjYdJowRki8zCMCrbLprOL-C_dQpcW5BxyFno';
const tlmsApiKey = 'BaZspQqVVZZrS2SX6vw9X9kgPF6MYT';

// Extract existing message texts for duplicate check
const existingMessages = (chatHistory.messages || []).map(m => m.text || '');

const results = [];

for (const item of completions) {
  const completion = item.json;
  const userId = completion.user_id;
  const courseId = completion.course_id;
  const userName = completion.user_name;
  const courseName = completion.course_name;

  // Check for duplicate
  const searchKey = `${userName} completed "${courseName}"`;
  const alreadySent = existingMessages.some(msg => msg.includes(searchKey));

  if (alreadySent) {
    results.push({
      json: {
        user_name: userName,
        course_name: courseName,
        status: 'skipped',
        reason: 'Already notified'
      }
    });
    continue;
  }

  // Fetch course details (score, start time, completion time)
  let score = null;
  let startTime = 'N/A';
  let completionTime = 'N/A';
  let totalSeconds = 0;

  try {
    const courseResponse = await this.helpers.httpRequest({
      method: 'GET',
      url: `https://ihealthlabs.talentlms.com/api/v1/getuserstatusincourse/user_id:${userId},course_id:${courseId}`,
      auth: { username: tlmsApiKey, password: '' }
    });

    // Get score from Test unit
    const units = courseResponse.units || [];
    const testUnit = units.find(u => u.type === 'Test');
    score = testUnit ? testUnit.score : null;

    // Get start and completion times
    startTime = courseResponse.enrolled_on || 'N/A';
    completionTime = courseResponse.completed_on || 'N/A';
    totalSeconds = courseResponse.total_time_seconds || 0;
  } catch (e) {}

  // Format duration
  let durationDisplay = 'N/A';
  if (totalSeconds > 0) {
    const hours = Math.floor(totalSeconds / 3600);
    const minutes = Math.floor((totalSeconds % 3600) / 60);
    if (hours === 0) durationDisplay = `${minutes} min`;
    else if (minutes === 0) durationDisplay = `${hours} hr`;
    else durationDisplay = `${hours} hr ${minutes} min`;
  }

  const scoreDisplay = score !== null ? `${score}%` : 'N/A';
  const messageText = `ðŸ“š ${userName} completed "${courseName}"\nStarted: ${startTime} | Completed: ${completionTime}\nDuration: ${durationDisplay} | Score: ${scoreDisplay}`;

  // Send notification
  try {
    await this.helpers.httpRequest({
      method: 'POST',
      url: webhookUrl,
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ text: messageText })
    });

    existingMessages.push(messageText);

    results.push({
      json: {
        user_name: userName,
        course_name: courseName,
        status: 'sent',
        message: messageText
      }
    });
  } catch (e) {
    results.push({
      json: {
        user_name: userName,
        course_name: courseName,
        status: 'failed',
        error: e.message
      }
    });
  }
}

return results.length > 0 ? results : [{ json: { message: 'No new completions to notify' } }];

